import { useEffect, useState } from "react"

import Items from "./Items";
import axios from "axios";
import { useLocation } from "react-router";

const List = () => {
    const [data, setData] = useState({});
    const {state} = useLocation();
  //   const onClick = async () => {
  //     try {
  //       const response = await axios.get(
  //         'http://3.35.213.205/api/ft/orderlist',{
  //           headers:{
  //             'x-ft-sessionid':state
  //           }
  //         })
  //           setData(response.data);
  //       } catch (e) {
  //           console.log(e);
  //       }
  // };
  useEffect(() => {
    axios.get(
      'http://3.35.213.205/api/ft/orderlist',{
        headers:{
          'X-Ft-Sessionid':state
        }
      }).then(res => {
        console.log(res.data)
        setData(res.data)
      })
  },[])

    return (
        <>
        {
          Array.isArray(data.orderitems) && 
          ( 
            data.orderitems.map((el, index) => {
              return (
                <>
                  <div key={index}>{el.company_name}
                    <Items items={el} barcodeNumber={state}/>
                  </div>

                </>
              )
            }))
        }
    <div>
      {data && (
        <textarea
          rows={7}
          value={JSON.stringify(data.orderitems, null, 2)}
          readOnly={true}
        />
      )}
    </div>
    </>
    )
}

export default List
